  return (
    <div className="container1">
      <h1 style={{fontWeight: "bold"}}>The online resume builder getting folks hired by Wipro, BBC, Google, Apple, Tesla, and Airbnb</h1>
      <a href="/form">get started</a>
      <div class="header-cta"> <a href="/form" class="n-btn-e n-btn-txt-icon btn-cta" data-nvt-action="cta_landing_build_resume"><span>Build My Resume<span class="n-icon n-btn-icon-arrow-right"></span></span></a> <p class="no-credit-card">No credit card required</p> </div>
      
    </div>
  );
};

export default Home;
